import React, { Component } from 'react'
import axios from 'axios'

class PlayPage extends Component {
  constructor(props){
    super()
    const log = function() {
      console.log(props.match.params.id)
    }
    log()
  }
  render() {
    return (
      <div>
        <p>{this.props.match.params.id}</p>
      </div>
    )
  }
}

export default PlayPage
